import React from "react";
import Input from "../../shared/components/FormElements/Input";
import "./NewPlace.css";

const NewPlace = () => {
  return (
    <form className="place-form">
      <Input
        element="input"
        type="text"
        label="Title"
        validators={[]}
        errorText="エラー : 有効なタイトルを入力してください"
      />
    </form>
  );
};

export default NewPlace;
